        private void loadPersonData_button_Click(object sender, EventArgs e)
        {
            OpenFileDialog openFileDialog = new OpenFileDialog();
            if (openFileDialog.ShowDialog() == DialogResult.OK)
            {
                Randomizer.personFilename = openFileDialog.FileName;
                FileStream fileStream = File.OpenRead(Randomizer.personFilename);
                Randomizer.personDataV = new byte[fileStream.Length];
                fileStream.Read(Randomizer.personDataV, 0, (int)fileStream.Length);
                if (Randomizer.personDataV.Length == 139456)
                {
                    fileStream.Close();
                }
                else
                {
                    int num = (int)MessageBox.Show("Your fixed_persondata.bin loaded fine, but the size doesn't seem right. You can continue with randomizing the file, but it may not work as intended. Please ensure you have the right file!", "Warning!", MessageBoxButtons.OK, MessageBoxIcon.Exclamation);
                    fileStream.Close();
                }
                Randomizer.personLoaded = true;
                updateAllDisplay();
            }
            else
            {
                int num1 = (int)MessageBox.Show("The fixed_persondata.bin file has NOT been loaded.", "Warning!", MessageBoxButtons.OK, MessageBoxIcon.Exclamation);
            }
        }

