        private void randomizeAndSave_button_Click(object sender, EventArgs e)
        {
            Randomizer.changelog = "\nBy Bly, Nifyr";
            if (!string.IsNullOrEmpty(this.seed_textBox.Text))
            {
                if (!Randomizer.isDigitsOnly(this.seed_textBox.Text))
                {
                    Randomizer.warnings += "\nThe seed's input was not solely numeric and was not used in randomization.";
                    Randomizer.rng = new RandomLog();
                    Randomizer.changelog += "\nNo seed used.";
                }
                else
                {
                    Randomizer.seed = Convert.ToInt32(this.seed_textBox.Text);
                    Randomizer.rng = new RandomLog(Randomizer.seed);
                    Randomizer.changelog += "\n\nSeed: " + Randomizer.seed.ToString();
                }
            }
            else
            {
                Randomizer.rng = new RandomLog();
                Randomizer.changelog += "\nNo seed used.";
            }
            if (!Randomizer.rangeWarnings.Equals(""))
            {
                int num = (int)MessageBox.Show(Randomizer.rangeWarnings + "\n\nDid not randomize data, nothing to output.", "Error: Could not Randomize!", MessageBoxButtons.OK, MessageBoxIcon.Hand);
                Randomizer.rangeWarnings = "";
            }
            else if (Randomizer.checkRanges())
            {
                int num2 = (int)MessageBox.Show("Please ensure that all maximum values in enabled ranges are equal to or larger than their respective minimums!\n\nDid not randomize data, nothing to output.", "Error: Could not Randomize!", MessageBoxButtons.OK, MessageBoxIcon.Hand);
            }
            else
            {
                Randomizer.randomizeTrue(settings);
                if (!Randomizer.warnings.Equals(""))
                {
                    int num4 = (int)MessageBox.Show("The following warnings were encountered while randomizing:" + Randomizer.warnings, "Warning!", MessageBoxButtons.OK, MessageBoxIcon.Exclamation);
                }
                this.saveFiles();
            }
            Randomizer.warnings = "";
        }

