        private void longSeek(BinaryWriter bw, long offset)
        {
            bw.Seek((int)(offset % int.MaxValue), SeekOrigin.Begin);
            for (int i = 0; i < offset/int.MaxValue; i++)
                bw.Seek(int.MaxValue, SeekOrigin.Current);
        }

        public static void PerformCycleStep(ProgressBar pb)
        {
            if (pb.Value == pb.Maximum)
                pb.Value = pb.Minimum;
            pb.PerformStep();
        }

