        private void loadCalendarData_button_Click(object sender, EventArgs e)
        {
            OpenFileDialog openFileDialog = new OpenFileDialog();
            if (openFileDialog.ShowDialog() == DialogResult.OK)
            {
                Randomizer.calendarFilename = openFileDialog.FileName;
                FileStream fileStream = File.OpenRead(Randomizer.calendarFilename);
                Randomizer.calendarDataV = new byte[fileStream.Length];
                fileStream.Read(Randomizer.calendarDataV, 0, (int)fileStream.Length);
                if (Randomizer.calendarDataV.Length == 14696)
                {
                    fileStream.Close();
                }
                else
                {
                    int num = (int)MessageBox.Show("Your fixed_calendardata.bin loaded fine, but the size doesn't seem right. You can continue with randomizing the file, but it may not work as intended. Please ensure you have the right file!", "Warning!", MessageBoxButtons.OK, MessageBoxIcon.Exclamation);
                    fileStream.Close();
                }
                Randomizer.calendarLoaded = true;
                updateAllDisplay();
            }
            else
            {
                int num1 = (int)MessageBox.Show("The fixed_calendardata.bin file has NOT been loaded.", "Warning!", MessageBoxButtons.OK, MessageBoxIcon.Exclamation);
            }
        }

